import React, { useRef } from 'react';
import { useHistory } from 'react-router';

import './modalAuthorized.css';

const ModalAuthorized = ({ cl, setModal }) => {
    const ref = useRef()
    let clazz = cl;

    const history = useHistory()

    return (
        <div className={`test ${clazz}`} ref={ref}>
            <div className='close-modal'>
                <p className='test-title'>Do u like post?</p>
                <button className='close-modal-like' onClick={() => setModal('hiden')}>X</button>
            </div>
            <p className='login-first'>login first</p>
            <hr />
            <button className='sign-in-modal' onClick={() => history.push('/login')}>Sign in</button>
        </div>
    )
}

export default ModalAuthorized;
